describe("Given a text and a subText that might be in the text, return the maximum distance from the subText to any side of the text", () => {
  const ejemplo1 = require("./ejemplo1");

  it("should return negative one", () => {
    expect(ejemplo1("ab", "k")).toBe(-1);
  });

  it("should return  maximum distance", () => {
    expect(ejemplo1("abcdefghi", "de")).toBe(4);

    expect(ejemplo1("abcdefgci", "c")).toBe(7);

    expect(
      ejemplo1(
        "wmsbexxcherystodmtfvldoaazzwrcbnoxtrprmoxapcdtkedzyxebdeazzadueyvpudeinbzshoprybjgkaxyyajybslslcnlitdcfzoebcnnqlckjpwihmleezgtbrqmygdlqmabcwmjuzulgxfbimebehakskuptbizbnxepezlfujlkdtwpmweppkbqgymrepinn",
        "kasasdkydwg"
      )
    ).toBe(-1);

    expect(
      ejemplo1(
        "",
        "ggwp"
      )
    ).toBe(770);

    expect(
      ejemplo1(
        "",
        "jfx"
      )
    ).toBe(606);
  });
});
